function Wrapper() {
  return (
    <S.wrapperS className="wrapper">
      <S.containerS className="container">
        <Main />
        <Bar />
        <footer className="footer"></footer>
      </S.containerS>
    </S.wrapperS>
  );
}

export default Wrapper;
